import React from 'react'
import firebase from '../utils/firebase'
import '../App2.css'



function Data({ data }) {
    return (
        <div className="stu">
            {data.name + " อ." + data.class + " เลขที่ " + data.number}
        </div>
    )
}

export default Data;
